import React from "react"
import './App.css';
import Flashcards from "./Flashcard";

import Header from "./Header"

class App extends React.Component {
  constructor(){
    super();
    this.state = {}
  }

  render(){
    return (
      <div className="App">
        <Header />
        <Flashcards />
      </div>
    )
  }
}

export default App;
